import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Admin() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    role: '',
    privilege: '',
  });
  const [message, setMessage] = useState('');

  const validateEmail = (email) => /^[a-zA-Z0-9._%+-]+@gmail\.com$/.test(email);

  // Function to sanitize any potential XSS payloads
  const sanitizeInput = (input) => {
    const element = document.createElement('div');
    element.innerText = input; // Escapes HTML content
    return element.innerHTML;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate the email format
    if (!validateEmail(formData.email)) {
      setMessage('Invalid email format. Only @gmail.com is allowed.');
      return;
    }

    // Sanitize all input fields before sending them to the backend
    const sanitizedFormData = {
      username: sanitizeInput(formData.username),
      email: sanitizeInput(formData.email),
      password: sanitizeInput(formData.password),
      role: sanitizeInput(formData.role),
      privilege: sanitizeInput(formData.privilege),
    };

    try {
      const response = await fetch('http://127.0.0.1:8000/api/admin', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(sanitizedFormData),
      });

      const result = await response.json();
      if (response.ok) {
        // Sanitize the message from the backend response
        setMessage(sanitizeInput(result.message));
        setFormData({
          username: '',
          email: '',
          password: '',
          role: '',
          privilege: '',
        });
      } else {
        setMessage(sanitizeInput(result.message || 'Failed to create account.'));
      }
    } catch (error) {
      setMessage('An error occurred while creating the account.');
    }
  };

  const handleChange = (e) => {
    // Sanitize input to prevent storing malicious scripts
    setFormData({
      ...formData,
      [e.target.name]: sanitizeInput(e.target.value),
    });
  };

  const handleNavigation = () => {
    navigate('/admin-create-account');
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Admin Registration</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Username:</label>
          <input
            type="text"
            name="username"
            value={formData.username}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Role:</label>
          <select name="role" value={formData.role} onChange={handleChange} required>
            <option value="">Select Role</option>
            <option value="Admin">Admin</option>
            <option value="Doctor">Doctor</option>
            <option value="Nurse">Nurse</option>
            <option value="Staff">Staff</option>
          </select>
        </div>
        <div>
          <label>Access Privilege:</label>
          <select name="privilege" value={formData.privilege} onChange={handleChange} required>
            <option value="">Select Privilege</option>
            <option value="Full Privilege">Full Privilege</option>
            <option value="Moderate Privilege">Moderate Privilege</option>
            <option value="Basic Privilege">Basic Privilege</option>
          </select>
        </div>
        <button type="submit">Create Account</button>
      </form>
      <button onClick={handleNavigation} style={{ marginTop: '10px' }}>
        Navigate to Create Account Page
      </button>
      {message && <p>{sanitizeInput(message)}</p>}
    </div>
  );
}

export default Admin;
